angular.module('reddeo', []);
angular.module('reddeo').config(['$interpolateProvider', function($interpolateProvider) {
	console.log('angular config works');
	$interpolateProvider.startSymbol('{[{');
	$interpolateProvider.endSymbol('}]}');
}]);
angular.module('reddeo').controller('FooController', ['$scope', function($scope){
  console.log('angular controller should work, check view binding');
  $scope.foo = 'hi';
}]);

angular.module('reddeo').run(function(){
	console.log('angular run works');
});